import { IonAvatar, IonIcon, IonTitle } from '@ionic/react';
import React from 'react';
import './header.css'
import imgas from '../images/Annotation 2024-01-23 201729.png';
import {heartOutline } from 'ionicons';

function Headers(props) {
  return (
    <>
      <div>
        <div className='header-container'>
          <IonTitle className='title-none'>{props.headersTitle}Phohtogram</IonTitle>
          <img className='profile-img' src={imgas} onClick={null}>{}</img>
          <ul className='header-ul'>
            <li><a href=''><IonIcon color='red' >{heartOutline}</IonIcon></a></li>
            <li><a href=''>adad</a></li>
          </ul>
        </div>
      </div>
    </>
  )
}

export default Headers
